import React from 'react';
import BookListItem from './BookListItem';

function BookList({ books }) {
  return (
    <div>
      {books.map(book => <BookListItem key={book.id} book={book} deleteBook={() => deleteBook(book.id)} />)}
    </div>
  );
}

export default BookList;
